import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';



function Car(props){
  return <h2>I am a {props.color}</h2>
}

function Garage(){
  return (<>
  <h1>who live here</h1>
  <Car color="red"></Car>
  </>)
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Garager/>)
